---------------------------------SELECTING CURRENT MONTHS PERPETUAL,ELA FLAG DATA WITH NULL AS CONTRACT DURATION------------------------------------------------
DELETE FROM $$STGDB.ST_PERPETUAL_ELA_TERM_ENRICHMENT_POS;
INSERT INTO $$STGDB.ST_PERPETUAL_ELA_TERM_ENRICHMENT_POS SELECT BOOKINGS_MEASURE_KEY,BOOKINGS_PROCESS_DATE ,BKGS_MEASURE_TRANS_TYPE_CODE,SALES_ORDER_KEY, NBM.PRODUCT_KEY FROM $$SLSORDVWDB.N_BOOKINGS_MEASURE NBM INNER JOIN $$COMREFVWDB.N_PRODUCT NP ON NBM.PRODUCT_KEY = NP.ITEM_KEY WHERE NP.MONETIZATION_TYPE_CD='perpetual' AND NP.ELA_FLG ='Y' AND BKGS_MEASURE_TRANS_TYPE_CODE in ('POS') AND NBM.DV_FISCAL_YEAR_MTH_NUMBER_INT = ( SELECT FISCAL_YEAR_MTH_NUMBER_INT FROM $$ETLVWDB.BKG_PROCESS_DT_CNTRL) AND DV_CONTRACT_DURATION IS NULL AND NBM.SERVICE_FLG = 'N';
COLLECT STATS ON $$STGDB.ST_PERPETUAL_ELA_TERM_ENRICHMENT_POS INDEX UPI_ST_PERPETUAL_ELA_TERM_ENRICHMENT_POS;
--------------------------------SELECTING MAX CONTRACT DURATION FOR EACH SALES ORDER LINE KEY BY LOOKING UP THE PAST ONE YEAR ERP DATA WITH TERM AS MONETIZATION----------------------------------------------------------------
DELETE FROM $$STGDB.ST_SOL_DURATION_POS;
INSERT INTO $$STGDB.ST_SOL_DURATION_POS SELECT SALES_ORDER_KEY, MAX(DV_CONTRACT_DURATION) AS DV_CONTRACT_DURATION FROM $$SLSORDVWDB.N_BOOKINGS_MEASURE NBM INNER JOIN $$COMREFVWDB.N_PRODUCT NP ON NBM.PRODUCT_KEY = NP.ITEM_KEY WHERE NP.MONETIZATION_TYPE_CD='TERM' AND BKGS_MEASURE_TRANS_TYPE_CODE in ('ERP') AND NBM.DV_FISCAL_YEAR_MTH_NUMBER_INT >= ( SELECT FISCAL_YEAR_MTH_NUMBER_INT-100 FROM $$ETLVWDB.BKG_PROCESS_DT_CNTRL) AND NBM.SALES_ORDER_KEY IN (SELECT DISTINCT SALES_ORDER_KEY FROM $$STGDB.ST_PERPETUAL_ELA_TERM_ENRICHMENT_POS WHERE SALES_ORDER_KEY > 0 ) AND DV_CONTRACT_DURATION IS NOT NULL AND NBM.SERVICE_FLG = 'N' GROUP BY 1;
COLLECT STATS ON $$STGDB.ST_SOL_DURATION_POS INDEX (SALES_ORDER_KEY) ;
