SET RU_SERVICE_CONTRACT_START_DTM = NULL, RU_SERVICE_CONTRACT_END_DTM = NULL, DV_CONTRACT_DURATION = ROUND(SOL.DV_CONTRACT_DURATION) , EDW_UPDATE_DATETIME = CURRENT_TIMESTAMP(0) , EDW_UPDATE_USER = USER WHERE NBM.BOOKINGS_MEASURE_KEY = WI.BOOKINGS_MEASURE_KEY AND NBM.BOOKINGS_PROCESS_DATE = WI.BOOKINGS_PROCESS_DATE AND NBM.BKGS_MEASURE_TRANS_TYPE_CODE = WI.BKGS_MEASURE_TRANS_TYPE_CODE AND WI.SALES_ORDER_KEY=SOL.SALES_ORDER_KEY AND NBM.BKGS_MEASURE_TRANS_TYPE_CODE='POS';
